import React from 'react';
import styled from 'styled-components';
export default function BottomSheet(){
    const Container = styled.div`
        position: fixed;
        z-index: 1;
        top: 0px;
        left: 0px;
        width: 100%;
        height: 100%;
        background-color:rgba(0,0,0,0.5);
        display: flex;
        align-items: flex-end;
        justify-content: center;
        display: none;
    `;
    return (
        <Container>
        </Container>
    );
}
